import React, { useState, useEffect } from 'react';
import { Link, useLocation } from 'react-router-dom';
import { FiMenu, FiX, FiHome, FiImage, FiGrid, FiUpload, FiUser, FiLogIn } from 'react-icons/fi';

const Navbar = ({ isAuthenticated }) => {
  const location = useLocation();
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [scrolled, setScrolled] = useState(false);

  const isActive = (path) => {
    if (path === '/') {
      return location.pathname === '/' || location.pathname === '/gallery';
    }
    return location.pathname.startsWith(path);
  };

  // Handle scroll effect
  useEffect(() => {
    const handleScroll = () => {
      if (window.scrollY > 10) {
        setScrolled(true);
      } else {
        setScrolled(false);
      }
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  // Close menu when route changes
  useEffect(() => {
    setIsMenuOpen(false);
  }, [location.pathname]);

  // Don't render navbar on home page
  if (location.pathname === '/') {
    return null;
  }

  return (
    <nav className={`navbar transition-all duration-300 ${scrolled ? 'py-2 shadow-md' : 'py-5'}`}>
      <div className="container mx-auto px-4 flex justify-between items-center">
        <Link 
          to="/" 
          className="text-2xl font-bold text-[#001F3F] flex items-center gap-2"
        >
          <FiImage className="text-[#A8E6CF]" /> 
          <span className="bg-gradient-to-r from-[#001F3F] to-[#708090] bg-clip-text text-transparent">PhotoPortfolio</span>
        </Link>

        {/* Desktop Navigation */}
        <ul className="nav-items hidden md:flex">
          <li>
            <Link 
              to="/" 
              className={`nav-link flex items-center gap-1 ${isActive('/') ? 'active' : ''}`}
            >
              <FiHome className="text-sm" /> Home
            </Link>
          </li>
          <li>
            <Link 
              to="/gallery" 
              className={`nav-link flex items-center gap-1 ${isActive('/gallery') ? 'active' : ''}`}
            >
              <FiGrid className="text-sm" /> Gallery
            </Link>
          </li>
          {isAuthenticated && (
            <>
              <li>
                <Link 
                  to="/admin" 
                  className={`nav-link flex items-center gap-1 ${isActive('/admin') ? 'active' : ''}`}
                >
                  <FiUser className="text-sm" /> Dashboard
                </Link>
              </li>

            </>
          )}
          {!isAuthenticated && (
            <li>
              <Link 
                to="/login" 
                className={`nav-link flex items-center gap-1 ${isActive('/login') ? 'active' : ''}`}
              >
                <FiLogIn className="text-sm" /> Login
              </Link>
            </li>
          )}
        </ul>

        {/* Mobile menu button */}
        <div className="md:hidden">
          <button
            onClick={() => setIsMenuOpen(!isMenuOpen)}
            className="text-[#001F3F] p-2 rounded-lg hover:bg-[#A8E6CF]/20 transition-colors"
            aria-label={isMenuOpen ? "Close menu" : "Open menu"}
          >
            {isMenuOpen ? <FiX size={24} /> : <FiMenu size={24} />}
          </button>
        </div>
      </div>

      {/* Mobile Navigation */}
      {isMenuOpen && (
        <div className="md:hidden bg-white/90 backdrop-blur-sm py-4 px-4 border-t border-[#708090]/20 animate-slideDown">
          <ul className="flex flex-col gap-3">
            <li>
              <Link 
                to="/" 
                className={`nav-link flex items-center gap-2 py-2 px-4 rounded-lg hover:bg-gradient-to-r hover:from-[#A8E6CF]/20 hover:to-[#6B8C6B]/20 ${isActive('/') ? 'active bg-gradient-to-r from-[#A8E6CF]/20 to-[#6B8C6B]/20' : ''}`}
                onClick={() => setIsMenuOpen(false)}
              >
                <FiHome /> Home
              </Link>
            </li>
            <li>
              <Link 
                to="/gallery" 
                className={`nav-link flex items-center gap-2 py-2 px-4 rounded-lg hover:bg-gradient-to-r hover:from-[#A8E6CF]/20 hover:to-[#6B8C6B]/20 ${isActive('/gallery') ? 'active bg-gradient-to-r from-[#A8E6CF]/20 to-[#6B8C6B]/20' : ''}`}
                onClick={() => setIsMenuOpen(false)}
              >
                <FiGrid /> Gallery
              </Link>
            </li>
            {isAuthenticated ? (
              <>
                <li>
                  <Link 
                    to="/admin" 
                    className={`nav-link flex items-center gap-2 py-2 px-4 rounded-lg hover:bg-gradient-to-r hover:from-[#A8E6CF]/20 hover:to-[#6B8C6B]/20 ${isActive('/admin') ? 'active bg-gradient-to-r from-[#A8E6CF]/20 to-[#6B8C6B]/20' : ''}`}
                    onClick={() => setIsMenuOpen(false)}
                  >
                    <FiUser /> Dashboard
                  </Link>
                </li>
                <li>
                  <Link 
                    to="/admin/upload" 
                    className={`nav-link flex items-center gap-2 py-2 px-4 rounded-lg hover:bg-gradient-to-r hover:from-[#A8E6CF]/20 hover:to-[#6B8C6B]/20 ${isActive('/admin/upload') ? 'active bg-gradient-to-r from-[#A8E6CF]/20 to-[#6B8C6B]/20' : ''}`}
                    onClick={() => setIsMenuOpen(false)}
                  >
                    <FiUpload /> Upload
                  </Link>
                </li>
              </>
            ) : (
              <li>
                <Link 
                  to="/login" 
                  className={`nav-link flex items-center gap-2 py-2 px-4 rounded-lg hover:bg-gradient-to-r hover:from-[#A8E6CF]/20 hover:to-[#6B8C6B]/20 ${isActive('/login') ? 'active bg-gradient-to-r from-[#A8E6CF]/20 to-[#6B8C6B]/20' : ''}`}
                  onClick={() => setIsMenuOpen(false)}
                >
                  <FiLogIn /> Login
                </Link>
              </li>
            )}
          </ul>
        </div>
      )}
    </nav>
  );
};

export default Navbar;
